    _FIELD_TABLE.ModificadoPor = {
        type: Sequelize.STRING(100),
        allowNull: true,
    };
    _FIELD_TABLE.FechaModificacion = {
        type: Sequelize.STRING(100),
        allowNull: true,
    };
    return _FIELD_TABLE;
}

